function getLleytonHewittData() {
  const lleytonHewittData = [
    { outcome: 'runner - up', year: 2000, championship: 'Stuttgart', surface: 'hard (i)', opponent: 'Wayne Ferreira', score: ['6 - 7 (6 - 8)', '6 - 3', '7 - 6 (7 - 5)', '6 - 7 (2 - 7)', '2 - 6'] },
    { outcome: 'winner', year: 2002, championship: 'Indian Wells', surface: 'hard', opponent: 'Tim Henman', score: ['6 - 1', '6 - 2'] },
    { outcome: 'runner - up', year: 2002, championship: 'Cincinnati', surface: 'hard', opponent: 'Carlos Moyá', score: ['5 - 7', '6 - 7 (5 - 7)'] },
    { outcome: 'runner - up', year: 2002, championship: 'Paris', surface: 'carpet (i)', opponent: 'Marat Safin', score: ['6 - 7 (4 - 7)', '0 - 6', '4 - 6'] },
    { outcome: 'winner', year: 2003, championship: 'Indian Wells (2)', surface: 'hard', opponent: 'Gustavo Kuerten', score: ['6 - 1', '6 - 1'] },
    { outcome: 'runner - up', year: 2004, championship: 'Cincinnati (2)', surface: 'hard', opponent: 'Andre Agassi', score: ['3 - 6', '6 - 3', '2 - 6'] },
    { outcome: 'runner - up', year: 2005, championship: 'Indian Wells', surface: 'hard', opponent: 'Roger Federer', score: ['2 - 6', '4 - 6', '4 - 6'] },
  ];

  const lleytonHewittDataFinal = [];

  for (let i = 0; i < lleytonHewittData.length; i++) {
    if (lleytonHewittData[i].outcome === 'winner') {
      continue;
    }

    let scoreCounted = 0;

    for (const item of lleytonHewittData[i].score) {

      const points = item.split(' - ').map((x) => parseInt(x));

      if (points[1] <= 6 && points[0] >= 1) {
        scoreCounted++;
      }

    }

    if (scoreCounted === lleytonHewittData[i].score.length) {

      lleytonHewittDataFinal.push({
        outcome: lleytonHewittData[i].outcome,
        year: lleytonHewittData[i].year,
        championship: lleytonHewittData[i].championship,
        surface: lleytonHewittData[i].surface,
        opponent: lleytonHewittData[i].opponent,
        score: lleytonHewittData[i].score
      });
    }
  }

  return lleytonHewittDataFinal;
}

