function createRelevantCells(data) {
  const answer = data.length === 19 ? 'TRUE' : 'FALSE';

  const relevantCells = data.map((item, index) => ({
    row_index: index,
    column_name: item.outcome
  }));

  return { "answer": answer, "relevant_cells": relevantCells };
}

